import React from 'react';

const UploadButton = ({ onClick, disabled }) => {
    return (
        <button
            onClick={onClick}
            className="px-6 py-2 text-white font-semibold bg-indigo-600 rounded-lg shadow-md hover:bg-indigo-700 transition-colors duration-200 disabled:bg-gray-600 disabled:cursor-not-allowed"
            disabled={disabled}
        >
            Update
        </button>
    );
};

export default UploadButton;
